{
  "openapi": "3.0.0",
  "info": {
    "title": "DAYFLY API for video synthesize",
    "description": "synthesize images and videos.",
    "version": "1-oas3"
  },
  "servers": [
    {
      "url": "http://127.0.0.1:5000",
      "description": "My API"
    }
  ],
  "paths": {
    "/api/model": {
      "post": {
        "summary": "Create video",
        "parameters": [
          {
            "in": "header",
            "name": "Content-Type",
            "description": "multipart/form-data",
            "required": true,
            "schema": {
              "type": "string",
              "example": "multipart/form-data"
            }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "multipart/form-data": {
              "schema": {
                "type": "object",
                "properties": {
                  "image_no": {
                    "type": "integer",
                    "description": "Image number selected by user"
                  },
                  "file": {
                    "type": "file",
                    "description": "Video uploaded by user via webcam"
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Video Created Successfully",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    },
                    "model_id": {
                      "type": "integer",
                      "example": 1
                    }
                  }
                }
              }
            }
          },
          "500": {
            "description": "Unexpected error",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": false
                    },
                    "message": {
                      "type": "string",
                      "example": "Something wrong"
                    },
                    "status": {
                      "type": "integer",
                      "example": 500
                    }
                  }
                }
              }
            }
          },
          "default": {
            "description": "Unexpected error"
          }
        }
      }
    },
    "/api/model/{model_id}": {
      "get": {
        "summary": "Call Outcomes",
        "description": "Returns mixed-video URL via Header's model_id.",
        "parameters": [
          {
            "name": "model_id",
            "in": "path",
            "required": true,
            "description": "model_id of mixed-video generated by user",
            "schema": {
              "type": "integer"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "URL returns Successfully",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    },
                    "model_result": {
                      "type": "string"
                    }
                  }
                }
              }
            }
          },
          "500": {
            "description": "Unexpected error",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": false
                    },
                    "message": {
                      "type": "string",
                      "example": "No model_id in Database"
                    },
                    "status": {
                      "type": "integer",
                      "example": 500
                    }
                  }
                }
              }
            }
          },
          "default": {
            "description": "Unexpected error"
          }
        }
      },
      "delete": {
        "summary": "Delete Mixed-Video",
        "description": "When the user presses Try again, find and delete the result from db with the model id",
        "parameters": [
          {
            "name": "model_id",
            "in": "path",
            "required": true,
            "description": "model_id of mixed-video generated by user",
            "schema": {
              "type": "integer"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Success to delete the mixed-video",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    }
                  }
                }
              }
            }
          },
          "500": {
            "description": "Falied to delete the mixed-video",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": false
                    },
                    "message": {
                      "type": "string",
                      "example": "No model_id in Database"
                    },
                    "status": {
                      "type": "integer",
                      "example": 500
                    }
                  }
                }
              }
            }
          },
          "default": {
            "description": "Unexpected error"
          }
        }
      },
      "patch": {
        "summary": "Update video information(nickname, category num)",
        "description": "When the user presses 'share it', it receives additional input information from the user and updates it.",
        "parameters": [
          {
            "name": "model_id",
            "in": "path",
            "required": true,
            "description": "model_id of mixed-video generated by user",
            "schema": {
              "type": "integer"
            }
          }
        ],
        "requestBody": {
          "description": "Update MIX-VIDEO Information (Adding Emoticons and Category Information)",
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "username": {
                    "type": "string"
                  },
                  "category_no": {
                    "type": "integer",
                    "example": 1
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Success to update information",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": true
                    }
                  }
                }
              }
            }
          },
          "500": {
            "description": "No model_id in Database",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": false
                    },
                    "message": {
                      "type": "string",
                      "example": "No model_id in Database"
                    },
                    "status": {
                      "type": "integer",
                      "example": 500
                    }
                  }
                }
              }
            }
          },
          "default": {
            "description": "unexpected error"
          }
        }
      }
    },
    "/api/model/gallery/{category_no}": {
      "get": {
        "summary": "Check Specific Category",
        "description": "Get all video information which belongs to category_no",
        "parameters": [
          {
            "name": "category_no",
            "in": "path",
            "required": true,
            "description": "Number of category selected by the user",
            "schema": {
              "type": "integer"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Success to call mixed-video corresponding to category_no",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean"
                    },
                    "data": {
                      "type": "object",
                      "example": [
                        {
                          "category_no": 1,
                          "image_no": 1,
                          "model_date": "date",
                          "model_id": 1,
                          "model_name": "string",
                          "model_result": "string"
                        }
                      ]
                    }
                  }
                }
              }
            }
          },
          "500": {
            "description": "Something wrong in database",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "success": {
                      "type": "boolean",
                      "example": false
                    },
                    "message": {
                      "type": "string",
                      "example": "Something wrong in database"
                    },
                    "status": {
                      "type": "integer",
                      "example": 500
                    }
                  }
                }
              }
            }
          },
          "default": {
            "description": "unexpected error"
          }
        }
      }
    }
  }
}
